#include <iostream>
#include <string>
using namespace std;

string makeFancyString(string& s) {
    int n = s.size();
    string str = "";
    for(int i=0; i<n; i++){
        if(s[i] == s[i+1] && s[i] == s[i+2]){
            continue;
        }
        str+=s[i];
    }
    return str;
}

